import React from 'react';
import {Formik, Form, Field, ErrorMessage} from 'formik';
import * as yup from 'yup';
import './medicos.css'


const medicos = () => {

    const handleCadastro = (values) => console.log(values);

    const validationMedicos = yup.object().shape({
        nome: yup.string().required("campo obrigatório"),
        crm: yup.number().required("campo obrigatório"),
    });

    return(
        <div className='container_medicos'>
            <h1 className='cadastro_titulo'>Cadastro de médicos</h1>
            <Formik initalValues={{}} onSubmit={handleCadastro} validationSchema={validationMedicos}>
                <Form className='form_cadastro'>
                    <Field name='nome' placeHolder='Nome'/>
                    <ErrorMessage component='spam' name='nome' className='form_error'/>

                    <Field name='crm' placeHolder='CRM'/>
                    <ErrorMessage component='spam' name='crm' className='form_error'/>

                    <button className='botao_cadastrar' type='submit'>Cadastrar</button>
                </Form>
            </Formik>
        </div>
    );
}

export default medicos;
